// @flow
import React from 'react';
import { Headline1, Colors } from 'class101-ui';

type Props = {
  color?: string,
};

const hiddenStyle = {
  marginBottom: 10,
};

const Component = ({
  color = Colors.gray800,
  ...restProps
}: Props) => (
  <Headline1
    style={ hiddenStyle }
    color={ color }
    { ...restProps }
  />
);

export default Component;
